Element.prototype.nextElement = function() {
  var n = this;
  do {
    n = n.nextSibling;
  } while (n && n.nodeType != 1);
  return n;
}

Element.prototype.prevElement = function() {
  var n = this;
  do {
    n = n.previousSibling;
  } while (n && n.nodeType != 1);
  return n;
}

Element.prototype.hasClass = function(c) {
  var cls = this.className.split(" ");
  for (var i = 0;i < cls.length;i++) {
    if (cls[i] == c) {
      return true;
    }
  }
  return false;
}

Element.prototype.addClass = function(c) {
  if (!this.hasClass(c)) {
    this.className += " " + c;
  }
  return this;
}

Element.prototype.removeClass = function(c) {
  var cls = this.className.split(" ");
  for (var i = 0;i < cls.length;i++) {
    if (cls[i] == c) {
      delete cls[i];
    }
  }
  this.className = cls.join(" ");
}

Element.prototype.toggleClass = function(c) {
  if (!this.hasClass(c)) {
    this.className += " " + c;
  } else {
    this.removeClass(c); 
  }

  return this;
}

Element.prototype.hide = function() {
  this.style.display = "none";
  return this;
}

Element.prototype.show = function() {
  this.style.display = "";
  return this;
}

Gamehub1.Ajax = ajax;

var ajax = function(options) {
  var data = null;
  this.options = {
    url: "",
    data: {},
    format: "json",
    method: "GET",
    before: null,
    callback: null,
  };
  for (var i in options) {
    this.options[i] = options[i];
  }
  try {
    this.req = new XMLHttpRequest(); 
  } catch(e) {
    try {
      this.req = new ActiveXObject("Microsoft.XMLHTTP");
    } catch(e) {
      return false; 
    }
  }

  this.headers = {
    "X-Requested-With": "XMLHTTPRequest",
    "Accept": 'text/javascript, text/html, application/xml, text/xml, */*'
  };

  var self = this;
  this.req.onreadystatechange = function() {
    if (self.req.readyState == 4 && self.req.status == 200) {
      if (self.options.format == "json") {
        if (this.responseText) {
          try {
            var result = JSON.parse(this.responseText);
          } catch(e) {
            var result = false;
          }
        }
      } else {
        var result = this.responseText;
      }
      if (self.options.callback) {
        return self.options.callback(result);
      }
    } 
  }

  var p = [];
  for (var i in this.options.data) {
    var v = this.options.data[i];
    if (typeof v == typeof {}) {
      v = JSON.stringify(v); 
    }
    p.push(i + "=" + encodeURIComponent(v));
  }

  if (p.length > 0) {
    if (this.options.method == "GET") {
      var c = this.options.url.indexOf("?") != -1 ? "&" : "?";
      this.options.url = this.options.url + c + p.join("&"); 
    }

    if (this.options.method == "POST") {
      data = p.join("&"); 
    }
  }

  this.req.open(this.options.method, this.options.url, true);

  for(var i in this.headers) {
    try {
      this.req.setRequestHeader(i, this.headers[i]);
    } catch(e) {
    }
  }

  if (this.options.method == "POST") {
    this.req.setRequestHeader("Content-type", "application/x-www-form-urlencoded");
  }

  this.req.send(data);
  console.log(this.req);

  if (this.options.before) {
    this.options.before();
  }
}

